/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<nav class="ui5-breadcrumbs-root" aria-label="${ifDefined(context._accessibleNameText)}"><ol @focusin="${context._onfocusin}" @keydown="${context._onkeydown}" @keyup="${context._onkeyup}"><li class="ui5-breadcrumbs-dropdown-arrow-link-wrapper" ?hidden="${context._isOverflowEmpty}"><${scopeTag("ui5-link", tags, suffix)} @click="${context._openRespPopover}" accessible-role="button" aria-label="${ifDefined(context._dropdownArrowAccessibleNameText)}" aria-haspopup="${ifDefined(context._ariaHasPopup)}"><${scopeTag("ui5-icon", tags, suffix)} name="slim-arrow-down" title="${ifDefined(context._dropdownArrowAccessibleNameText)}"></${scopeTag("ui5-icon", tags, suffix)}></${scopeTag("ui5-link", tags, suffix)}></li>${ repeat(context._linksData, (item, index) => item._id || index, (item, index) => block1(item, index, context, tags, suffix)) }${ context._endsWithCurrentLocationLabel ? block2(context, tags, suffix) : undefined }</ol></nav>`;
const block1 = (item, index, context, tags, suffix) => html`<li class="ui5-breadcrumbs-link-wrapper" @click="${context._onLinkPress}" id="${ifDefined(item._id)}-link-wrapper"><${scopeTag("ui5-link", tags, suffix)} href="${ifDefined(item.href)}" target="${ifDefined(item.target)}" id="${ifDefined(item._id)}-link" aria-label="${ifDefined(item.accessibleName)}" data-ui5-stable="${ifDefined(item.stableDomRef)}">${ifDefined(item.innerText)}</${scopeTag("ui5-link", tags, suffix)}></li>`;
const block2 = (context, tags, suffix) => html`<li class="ui5-breadcrumbs-current-location" @click="${context._onLabelPress}"><span id=${ifDefined(context._id)}-labelWrapper><${scopeTag("ui5-label", tags, suffix)} aria-current="page">${ifDefined(context._currentLocationText)}</${scopeTag("ui5-label", tags, suffix)}></span></li>`;


export default block0;
